<script>
    var dicModel = JSON.parse('[]');
    function ChooseRealAuth(result, bizTypeCode, callback, errorcallback) {
           if ("" == "C") {
               if (bridge.hasNativeMethod('thirdTakeVideo')) {
                   //如果是app则需要开启摄像头权限
                   bridge.call("thirdTakeVideo", function (err) {
                       if (err == "1") {
                           RealAuth(result, bizTypeCode, callback, errorcallback);
                       }
                   });
               } else {
                   RealAuth(result, bizTypeCode, callback, errorcallback);
               }
            } else {
                RealAuth(result, bizTypeCode, callback, errorcallback);
            }
        }


        function RealAuth(result, bizTypeCode, callback, errorcallback) {
            if ('' == "1") {//如果身份验核还没有过期
                if (typeof callback == "function") {
                    callback();
                }
            }
            else if ('' == "1" || result == true) {//需要实名验证
                var opear = [];
                if (!dicModel || dicModel.length == 0) {
                    $.alert("暂无可实名的服务商！");
                    return false;
                } else if (dicModel.length > 1) {
                    $.each(dicModel, function (k, n) {
                        opear.push({
                            text: n.ProviderName,
                            className: "color-primary",
                            onClick: function () {
                                $.showLoading();
                                $.post("/wxfwpt/Biz/RealNameAuth", { realAuthTypeCode: n.ProviderCode, realNameAuthBizType: ("" || bizTypeCode) }, function (data) {
                                    $.hideLoading();
                                    if (data[0]) {
                                        if (n.ProviderCode == "2") {
                                            $.hideLoading(); $(".loading2").find("p").text("跳转中"); $(".loading2").show(); // $.showLoading("跳转中");
                                            location.href = data[1];
                                        } else if (n.ProviderCode == "10") {
                                            //$('.assessFrame iframe').attr('src', data[1]);
                                            //$('.assessFrame').addClass("weui_dialog_visible").show();
                                            //$('body').css('overflow', 'hidden');
                                            $.hideLoading(); $(".loading2").find("p").text("跳转中"); $(".loading2").show(); // $.showLoading("跳转中");
                                            location.href = data[1];
                                        } else {
                                            dsBridge.call("getCertificationImage", "", function (param) {
                                                if (param) {
                                                    $.showLoading();
                                                    $.post("/wxfwpt/Biz/JAPersonContrast", { url: data[1], Base64Photo: param }, function (jaresult) {
                                                        $.hideLoading();
                                                        if (jaresult[0]) {
                                                            if (typeof callback == "function") {
                                                                callback();
                                                            } else {
                                                                window.location.reload();
                                                            }
                                                        } else {
                                                            if (typeof errorcallback == "function") {
                                                                errorcallback();
                                                            }
                                                            $.alert(jaresult[1]);
                                                        }
                                                    });
                                                } else {
                                                    if (typeof errorcallback == "function") {
                                                        errorcallback();
                                                    }
                                                }

                                            });
                                        }
                                    } else {
                                        if (typeof errorcallback == "function") {
                                            errorcallback();
                                        }
                                        $.alert(data[1]);
                                    }
                                });
                            }
                        });
                    });
                    $.actions({
                        title: "选择需要实名的服务商",
                        onClose: function () {

                        },
                        initDone: function () {
                            $(document).off('tap click', '.weui_actions_mask');
                            $('.weui_actionsheet_action').tap(function () {
                                var url = location.href;
                                if (url.toLowerCase().indexOf("olaplupload") > -1 || url.toLowerCase().indexOf("pcrinfo") > -1) {

                                } else {
                                   dsBridge.call('goHome', '');
                                }

                            });
                        },
                        actions: opear
                    });
                    localStorage.setItem("WX_ReturnUrl", window.location.href);
                } else {
                    $.showLoading();
                    $.post("/wxfwpt/Biz/RealNameAuth", { realAuthTypeCode: dicModel[0].ProviderCode, realNameAuthBizType: ("" || bizTypeCode) }, function (data) {
                        $.hideLoading();
                        if (data[0]) {
                            if (dicModel[0].ProviderCode == "2") {
                                $.hideLoading(); $(".loading2").find("p").text("跳转中"); $(".loading2").show(); // $.showLoading("跳转中");
                                location.href = data[1];
                            } else if (dicModel[0].ProviderCode == "10") {
                                $.hideLoading(); $(".loading2").find("p").text("跳转中"); $(".loading2").show(); // $.showLoading("跳转中");
                                location.href = data[1];
                            } else {
                                dsBridge.call("getCertificationImage", "", function (param) {
                                    if (param) {
                                        $.showLoading();
                                        $.post("/wxfwpt/Biz/JAPersonContrast", { url: data[1], Base64Photo: param }, function (jaresult) {
                                            $.hideLoading();
                                            if (jaresult[0]) {
                                                if (typeof callback == "function") {
                                                    callback();
                                                } else {
                                                    window.location.reload();
                                                }
                                            } else {
                                                if (typeof errorcallback == "function") {
                                                    errorcallback();
                                                }
                                                $.alert(jaresult[1]);
                                            }
                                        });
                                    } else {
                                        if (typeof errorcallback == "function") {
                                            errorcallback();
                                        }
                                    }

                                });
                            }
                        } else {
                            if (typeof errorcallback == "function") {
                                errorcallback();
                            }
                            $.alert(data[1]);
                        }
                    });
                    localStorage.setItem("WX_ReturnUrl", window.location.href);
                }
            }
            else {
                if (typeof callback == "function") {
                    callback();
                }
            }
        }

</script>
